import logsStore from "../stores/logsStore";
import React from 'react';
import Log from "./Log";

export default function Logs() {
    const store = logsStore();

    return(
        <div>
        <h2>Logs:</h2>
        {store.logs && store.logs.map(log => {
            return <Log log={log} key={log._id} />
        })}
      </div>
    );
}
